function launch() public {
    // Only the current owner can call this function
    require(msg.sender == owner(), "Ownable: caller is not the owner");

    // 1. Enable trading on the token
    require(address(token).code.length > 0);
    token.openTrading();

    // 2. Retrieve the contract’s entire token balance
    require(address(token).code.length > 0);
    uint256 contractBalance = token.balanceOf(address(this));

    // Redundant—but present in the decompiled logic
    require(contractBalance == contractBalance);

    // 3. Transfer the entire balance to the staking contract
    require(address(token).code.length > 0);
    token.transfer(address(staking), contractBalance);

    // Another redundant equality check (kept for logical fidelity)
    require(contractBalance == contractBalance);

    // 4. Hand token ownership back to the owner
    require(address(token).code.length > 0);
    token.transferOwnership(owner());
}
